<p>在 go 语言中，实现反射能力的是 <code>reflect</code>包，能够让程序操作不同类型的对象。其中，在反射包中有两个非常重要的 <strong>类型</strong>和 <strong>函数</strong>，两个函数分别是：</p>
<ul>
<li><strong><code>reflect.TypeOf</code></strong> - 能获取对象的类型的信息</li>
<li><strong><code>reflect.ValueOf</code></strong> - 能获取对象的数据</li>
